import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import '../Login/Login.css';


function Login() {
  return (
    <div className="lognbg">

      <div className="logbg ">
        <div className='login mt-5'>
          <span className='title text-warning'>Login</span>
          <form action="" className='formdata mt-5'>
            <input type="text" placeholder='Username'
            name='username'/><br/>
            <input type="password" placeholder='Password' /><br/>
            <span>forget password?</span><br />
            <span><input type="checkbox" /> Remember me</span><br/>
            <button>Login</button><br/>
            <span>have no account?<a href="">signupp</a></span>
          </form>
        </div>
    </div>
    </div>
  );
}

export default Login;
